GADGET_FILE_PREFIX = 'gadget_'
DEFAULT_ICON_SIZE = 3

def show_open_window(location=(None, None)):
    active_gadgets = sg.user_settings_get_entry('-active_gadgets-', [])
    files = os.listdir(os.path.dirname(__file__))
    gadgets = []
    gadgets_names = []
    for file in files:
        if GADGET_FILE_PREFIX in file and file.endswith(('.py', '.pyw')):
            gadget_name = file[file.find(GADGET_FILE_PREFIX)+len(GADGET_FILE_PREFIX):]
            gadget_name = gadget_name.split('.')[0]
            gadgets.append(file)
            gadgets_names.append(gadget_name)
    max_length = max(len(string) for string in gadgets_names)

    NUM_COLS = 3

    gadget_frame = sg.Frame('Active Gagdets',  [[sg.Checkbox(a1, default=True if a1 in active_gadgets else False, s=max_length, k=a1) for a1 in gadgets_names[i:i + NUM_COLS]] for i in range(0, len(gadgets_names), NUM_COLS)])

    layout = [  [sg.Text('Gadget Settings')],
                [gadget_frame],
                [sg.Button('Save'), sg.Button('Cancel')]  ]

    window = sg.Window('Gadget Settings', layout, location=location)
    while True:
        event, values = window.read()
        # print(event, values)
        if event == sg.WIN_CLOSED or event == 'Cancel':
            break
        if event == 'Save':
            active_gadgets = []
            for key in values.keys():
                if values[key] is True:
                    active_gadgets.append(key)
            sg.user_settings_set_entry('-active_gadgets-', active_gadgets)
            kill_all()
            start_all()
            break
    window.close()


def start_all():
    active_gadgets = sg.user_settings_get_entry('-active_gadgets-', [])
    files = os.listdir(os.path.dirname(__file__))
    # gadgets = []
    # gadgets_names = []
    for file in files:
        if GADGET_FILE_PREFIX in file and file.endswith(('.py', '.pyw')):
            gadget_name = file[file.find(GADGET_FILE_PREFIX)+len(GADGET_FILE_PREFIX):]
            gadget_name = gadget_name.split('.')[0]
            # gadgets.append(file)
            # gadgets_names.append(gadget_name)
            if gadget_name in active_gadgets:
                # sg.Print(f'starting {file}')
                sg.execute_py_file(os.path.join(os.path.dirname(__file__), file), wait=False)


def right_click_menu():
    icon_size = sg.user_settings_get_entry('-icon size-', DEFAULT_ICON_SIZE)
    alpha = sg.user_settings_get_entry('-alpha-', 1)*10
    menu = [[''], [  'Open',
                     'Brightness', [f'{x}{" "+sg.SYMBOL_CHECK_SMALL if x == alpha else "  "}::alpha' for x in range(1, 11)],
                     'Icon Size (1=largest)', [f'{x}{" "+sg.SYMBOL_CHECK_SMALL if x == icon_size else "  "}::size' for x in range(1, 7)],
                     'Show in Explorer',
                     'Edit Me',
                     'Version',
                     'Exit',]
                        ]
    return menu


def main():

    sg.user_settings_filename(filename='psggadgets.json')
    upgrade_check()
    sg.user_settings_filename(filename='psggadgets.json')

    layout = [[sg.Image(source=icon(), key='-GADGETS ICON-', p=0, subsample=sg.user_settings_get_entry('-icon size-', DEFAULT_ICON_SIZE), enable_events=True, right_click_menu=right_click_menu(), tooltip='Drag icon anywhere on your desktop\nRight click to open')]]

    window = sg.Window('psggadget', layout,
                       no_titlebar=True,
                       keep_on_top=True,
                       margins=(0,0),
                       grab_anywhere=True,
                       element_padding=(0,0),
                       auto_save_location=True,
                       transparent_color=sg.theme_background_color(),
                       alpha_channel=sg.user_settings_get_entry('-alpha-', None),
                       finalize=True)

    start_all()
    #------------ The Event Loop ------------#
    while True:
        event, values = window.read()
        print(event, values)
        if event == sg.WIN_CLOSED or event == 'Exit':
            kill_all()
            break

        if event.endswith('alpha') and not sg.SYMBOL_CHECK_SMALL in event:     # if a new alpha is chosen
            alpha = int(event.split('::')[0])/10
            window.set_alpha(alpha)
            sg.user_settings_set_entry('-alpha-', alpha)
            window['-GADGETS ICON-'].set_right_click_menu(right_click_menu())
        elif event.endswith('size') and not sg.SYMBOL_CHECK_SMALL in event:    # if a new size is chosen
            size = int(event.split('::')[0])
            window['-GADGETS ICON-'].update(icon(), subsample=size)
            sg.user_settings_set_entry('-icon size-', size)
            window['-GADGETS ICON-'].set_right_click_menu(right_click_menu())
        elif event == 'Close All':
            kill_all()
        elif event == 'Open':
            location = window.current_location()
            window.hide()
            show_open_window(location)
            window.un_hide()
        elif event == 'Edit Me':
            sg.execute_editor(__file__)
        elif event == 'Version':
            sg.popup_scrolled( f'This Program: {__file__} version {version}', sg.get_versions(), keep_on_top=True, location=window.current_location(), no_buttons=True, no_sizegrip=True)
        elif event == 'Show in Explorer':
            sg.execute_file_explorer(os.path.dirname(__file__))
    window.close()


def get_all_procs():
    psutil.cpu_percent(interval=.1)
    procs = psutil.process_iter()
    all_procs = []
    for proc in procs:
        try:
            all_procs.append([proc.cpu_percent(), proc.name(), proc.pid, proc.cmdline()])
        except: pass

    disp_data = []
    for process in all_procs:
        try:
            name = process[3][1]
        except:
            name = ''
        disp_data.append([process[2], process[0]/10, process[1], name])
    return disp_data


def show_list_by_name():
    disp_data = get_all_procs()
    disp_data = sorted(disp_data, key=operator.itemgetter(3), reverse=False)
    display_list = []
    process_list = []
    for process in disp_data:
        # sg.Print(f'{process[3]}')
        if 'python' in process[2].lower() and GADGET_FILE_PREFIX in process[3].lower():
            display_list.append('{:5d} {:5.2f} {} {}\n'.format(process[0], process[1], process[2], process[3]))
            process_list.append([process[0], process[1], process[2], process[3]])
    return process_list
    # return display_list

def kill_all():
    processes_to_kill = show_list_by_name()
    # sg.Print(f'process list = {processes_to_kill}')
    for proc in processes_to_kill:
        # sg.Print(proc)
        pid = int(proc[0])
        # sg.Print(f'kill pid {pid} name {proc[3]}')
        if pid == os.getpid():
            # print(f'Skipping {proc[3]}')
            continue
        # print(f'killing {proc[3]}')
        try:
            kill_proc(pid=pid)
        #     # kill_proc_tree(pid=pid)
        except Exception as e:
            pass


def kill_proc(pid, sig=signal.SIGTERM, include_parent=True,
                   timeout=None, on_terminate=None):
    """Kill a process tree (including grandchildren) with signal
    "sig" and return a (gone, still_alive) tuple.
    "on_terminate", if specified, is a callabck function which is
    called as soon as a child terminates.
    """
    if pid == os.getpid():
        raise RuntimeError("I refuse to kill myself")
    parent = psutil.Process(pid)
    parent.send_signal(sig)



